import PopupWithForm from "./PopupWithForm";

const PopupAdd = () => {
  <PopupWithForm>
    return (
      <fieldset className="popup__set">
        <label className="popup__field">
          <input type="text" className="popup__input" id="popup-place-name" name="name" placeholder="Название" minlength="2" maxlength="30" required />
          <span className="popup-place-name-error popup__input-error"></span>
        </label>

        <label className="popup__field">
          <input type="url" className="popup__input" id="popup-src" name="link" placeholder="Ссылка на картинку" required />
          <span className="popup-src-error popup__input-error"></span>
        </label>

        <button className="popup__submit-button button" id="popupAdd-submitButton" type="submit" aria-label="Кнопка 'Создать'">Создать</button>
      </fieldset>
    )
  </PopupWithForm>
  }

export default PopupAdd;
